export const SET_CATEGORY = "SET_CATEGORY";
export const ADD_RECIPE = "ADD_RECIPE";
const dispach=(()=>{});
export default ()=>
{
     dispach = useDispatch();


}
export const getRecipes =() => {
    
    axios.get("http://localhost:8080/api/recipe")
        .then((data) => {
            
            console.log( data.data)
            dispach({ type: GET_RECIPES, recipes:data.data })
        });
}
